import { useNavigation } from '@react-navigation/native'
import React from 'react'
import { useState } from 'react'
import { View } from 'react-native'
import { Button, Subheading, TextInput, Title } from 'react-native-paper'
import { ScreenContainer } from '../../components/ScreenContainer/ScreenContainer'
import { styles } from './styles'

export const CreatePassword = () => {

  const navigation = useNavigation()
  const [email, setEmail] = useState('')

  return (
    <ScreenContainer>
      <View style={{ flex: 1, marginHorizontal: '8%', alignContent:'center', alignItems:'center'}}>
        <Title style={{marginTop: '50%', marginBottom: '10%'}}>Create a new Pasword</Title>
        <TextInput
          placeholder="Password"
          onChangeText={(passwordText) => setEmail(passwordText)}
          value={email}
          style={styles.textInput}
          autoCapitalize='none'
          underlineColor='transparent'
          mode="outlined"
          secureTextEntry={true}
        />
        <TextInput
          placeholder="Confirm Password"
          onChangeText={(confirmPassword) => setEmail(confirmPassword)}
          value={email}
          style={styles.textInput}
          autoCapitalize='none'
          underlineColor='transparent'
          mode="outlined"
          secureTextEntry={true}
        />
        <Button
          mode="contained"
          style={styles.continueButton}
          onPress={() => navigation.navigate('Complete Registration')}
        >
          Continue
        </Button>
        <Subheading>Enter a combination of at least six numbers, letters, and special characters</Subheading>
      </View>
    </ScreenContainer>
  )
}
